SECTION 1. Funds. The governor may make supplemental allotments from the airport revenue fund or airport revenue bond funds, or transfer unrequired balances from other unlapsed projects in this Act or prior appropriation acts that authorized the use of airport passenger facility charge funds; provided further that such supplemental allotments shall not be used to increase the scope of the project; provided further that such supplemental allotments shall not impair the ability of the fund to meet the purposes for which it was established; and provided further that the governor, at the governor’s discretion, is authorized to increase the passenger facility charge fund authorization ceiling for the program to accommodate the expenditure of such funds.

SECTION 25. The governor may supplement funds for any cost element for a capital improvement project authorized under this Act by transferring such sums as may be needed from the funds appropriated for other cost elements of the same project by this Act or any other prior or future act which has not lapsed; provided that the total expenditure of funds for all cost elements shall not exceed the total appropriations for that project.

SECTION 26. Any provision of this Act to the contrary notwithstanding, the appropriations made for capital improvement projects authorized under this Act shall not lapse at the end of the fiscal biennium for which the appropriation is made;

1 appropriation for charter schools (EDN600) shall be considered the non-facility appropriation for charter schools; provided further that, for the purposes of this section, all grant appropriations issued pursuant to chapter 42F, Hawaii Revised Statutes, shall be excluded from non-facility appropriations for the department of education and charter schools; and provided further that, notwithstanding any other law to the contrary, for fiscal year 2025-2026 and fiscal year 2026-2027, the director of finance shall:

(1) Determine the sum of general fund appropriations made for the department of education and charter school student non-facility costs;
(2) Determine the sum of department of education and charter school student enrollment based upon verified actual student enrollment counts as of October 15;
(3) Determine a per pupil amount by dividing the sum of general fund appropriations determined under paragraph (1) by the sum of student enrollment determined under paragraph (2);
(4) Transfer a general fund amount between the department of education and charter schools prior to November 1, 2025, and November 1, 2026, respectively, that will provide each with a per pupil allocation equal to the amount determined on an annualized fiscal year basis under paragraph (3); and
